import { json } from "body-parser";
import React from "react";
import {useState, useEffect} from "react";

function Todo(){

    const [data, setData]= useState([])
    const item=[];

    const noticePage = () =>{
        for(let i=0;i<3;i=i+1){
            item.push(data);
        }
    }

    useEffect(()=>{
        apiGet();  
    },[])
    const apiGet = ()=>{
        fetch('http://localhost:1337/api/notice')
        .then((response)=>response.json())
        .then((json)=>{
            setData(json.stringfy);
            for(let i=0;i<json.user.length;i=i+1){
                item.push(json.user[i]);
                console.log(json.user[i].name);
            }
        })
    }


    return (

        <div>
      <h1>Featured Products</h1>
      <div >
          <button onClick={noticePage}>Click</button>
          {item}
      </div>
    </div>
    )
}

export default Todo

